import React, {Component} from 'react';


class Form extends Component {

    submitHandler = () => {
        //send to API team name, number task, answers, attemp number
        console.log("submit");
    }

    render() {
        return (
            <div className="Form">
                <form onSubmit={this.submitHandler.bind(this)}>
                    <input id="answer1" type="text" maxLength="20" name="answer1"/>
                    <label htmlFor="answer1">1.</label>
                    <input id="answer2" type="text" maxLength="20" name="answer2"/>
                    <label htmlFor="answer1">2.</label>
                    <input id="answer3" type="text" maxLength="20" name="answer3"/>
                    <label htmlFor="answer1">3.</label>
                    <input id="answer4" type="text" maxLength="20" name="answer4"/>
                    <label htmlFor="answer1">4.</label>
                    <input id="answer5" type="text" maxLength="20" name="answer5"/>
                    <label htmlFor="answer1">5.</label>
                    <button type="submit">
                        Отправить ответы
                    </button>
                </form>
            </div>
        )
    }
}

export default Form;
